s\":\"FT\"}}},{\"timeEpochMilli\":\"1594385358000\",\"transaction\":{\"type\":\"TRANSACTION_IMPORT\",\"player\":{\"proPlayer\":{\"id\":10335,\"nameFull\":\"Carlos Hyde\",\"nameShort\":\"C. Hyde\",\"proTeamAbbreviation\":\"SEA\",\"position\":\"RB\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/10335.png\",\"nflByeWeek\":6,\"news\":[{\"timeEpochMilli\":\"1605849796000\",\"contents\":\"Hyde (hamstring) rushed 14 times for 79 yards and a touchdown and secured two of three targets for 16 yards in the Seahawks' 28-21 win over the Cardinals on Thursday night. He also recovered his own fumble late in the fourth quarter.\",\"analysis\":\"Suiting up for the first time since Week 7, Hyde handled clear lead-back duties on a night when Chris Carson (foot) remained sidelined. The veteran performed admirably, consistently rattling off productive runs and also finding the end zone from two yards out in the latter portion of the third quarter for this third touchdown of the campaign. However, Hyde's otherwise impressive night was at risk of being sullied by a key mistake, as he never quite got the handle on a pitchback from Russell Wilson at Arizona's 23-yard line with 2;54 remaining but managed to recover and possess the ball long enough to withstand a replay challenge by the Cardinals after Budda Baker appeared to subsequently rip the ball from him. Carson reportedly has a good chance to return for the Seahawks' Week 12 matchup against the Eagles on Monday night, Nov. 30, but Hyde has certainly proven a capable fill-in if he's needed once again.\",\"title\":\"Performs well as lead back\"},{\"timeEpochMilli\":\"1605849673000\",\"contents\":\"Seattle Seahawks running back Carlos Hyde missed the last few games for the team, but he knocked off that rust en route to a strong day in Week 11 against the Arizona Cardinals on Thursday night. He finished the game with 14 carries for 79 yards and a touchdown. He also caught two of his three targets for 16 yards. It was clear by